package com.class8;

public class ForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i=0; i<=4; i++) {
			
			System.out.println("Good morning");
			
		}
		System.out.println("**************************");
		for (int i=1; i<=10; i++) {
			System.out.println(i);
			
		}System.out.println("*****************************");
		for (int i=0; i<=50; i+=5) {
			System.out.print(i+" ");
			
		}
		

	}

}
